import React from "react";

function MainLanding(props) {
  return (
    <div>
      <h2>Welcome to Barnwood!</h2>
        <p style={{marginTop: "30px"}}>
          This is a React application for creating, reading, updating, and deleting products and orders.
          Keep in mind that currently this application is for testing only, and all "payments" done are only done in a 
          Paypal sandbox environment using false money so don't expect to actually get an order delivered to you!
        </p>
    </div>
  )
}

export default MainLanding;
